import React from "react";
import Info from "./Info";
import Craousel from "./Carousel";
function MainContainer() {
  return (
    <main className="container">
      <div className="row">
        <div className="col-12">
          <Craousel />
        </div>
      </div>
      <div className="row">
        <div className="col-lg-4"></div>
        <Info />
      </div>
    </main>
  );
}

export default MainContainer;
